dule_id and scdata.ticketId = pl.ticket_id and scdata.channel_id = pl.channel_id and pl.catalog_id = '0' and pl.is_adjust_pricing = '1' and pl.deleted = '0') as shouldbe) as final where final.partner_net_price != final.should_be and final.should_be != 'No_Setting_found' and final.row_type != '1'
